// //public routes
// { path: '/login', isPublic: true, component: login },
// { path: '/forgot-password', isPublic: true },

// //authenticated routes
// { path: '/dashboard', component: dashboard }
import Dashboard from './pages/dashboard/Dashboard'
import AddDriver from './pages/driver/AddDriver'
import DriverList from './pages/driver/DriverList'


const routes = [
    {
        path: "/dashboard",
        name: "Dashboard",
        icon: "ni ni-chart-pie-35 text-info",
        component: Dashboard
    }, {
        collapse: true,
        name: "Driver",
        state: "testCollapse",
        icon: "ni ni-chart-pie-35 text-info",
        views: [
            {
                path: "/add-driver",
                miniName: "AD",
                name: "Add Driver",
                component: AddDriver,
            }, {
                path: "/driver-list",
                name: "Driver List",
                miniName: "DL",
                component: DriverList,
            }
        ]
    }, {
        collapse: true,
        name: "Rider",
        state: "test2Collapse",
        icon: "ni ni-chart-pie-35 text-info",
        views: [
            {
                path: "/add-rider",
                name: "Add Driver",
                miniName: "AR",
                component: Dashboard,
            }, {
                path: "/rider-list",
                name: "Rider List",
                miniName: "RL",
                component: Dashboard,
            }
        ]
    }
]
export default routes;
